import React from "react";
import programming from "../data/programming";

const ProgrammingSkills = ({ programming }) => {
    return (
        <li className="skill-container"> 
             <p className="skill-name"> {programming.language} </p>
             <div className="base">           
             <div className={`skill-bar ${programming.id}`} style={{ width: `${programming.level}%` }} > </div>
             </div>      
        </li>
    )
}

export default ProgrammingSkills;
